CREATE TABLE C_APPLICATIONS
(
  ID number(15) not null primary key,
  NAME varchar(256) NOT NULL ,
  COMPANY varchar(256),
  -- 调用接口时应用唯一标识
  APP_CODE varchar(256) NOT NULL,
  REFRESH_RESOURCES_API varchar(256),
  -- 此application所在的所有ip:ports，用分号分隔。如: 192.168.6.97:8080;192.168.6.98:8080
  --
  -- 加入已经作为微服务加入服务注册中心，无需填写此字段。系统会自动把app_code当做服务id，通过负载均衡器在服务中心找到对应服务。
  HOSTS varchar(256),
  CREATED_TIME number(15) DEFAULT 0 NOT NULL,
  MODIFIED_TIME number(15) DEFAULT 0 NOT NULL,
  STATUS int DEFAULT 1 NOT NULL,
  -- 属于paas服务还是saas服务
  SERVICE_MODE varchar(5) DEFAULT 'paas' NOT NULL,
  -- 更新的人
  UPDATED_BY_USER_NAME varchar(100) DEFAULT ' ' NOT NULL,
  DEFAULT_INDEX_URL varchar(256) DEFAULT '' NOT NULL
);
COMMENT ON TABLE "C_APPLICATIONS" IS '应用表';
COMMENT ON COLUMN "C_APPLICATIONS"."ID" IS '表主键';
COMMENT ON COLUMN "C_APPLICATIONS"."NAME" IS '应用名称';
COMMENT ON COLUMN "C_APPLICATIONS"."COMPANY" IS '所属公司';
COMMENT ON COLUMN "C_APPLICATIONS"."APP_CODE" IS '应用标识';
COMMENT ON COLUMN "C_APPLICATIONS"."REFRESH_RESOURCES_API" IS '刷新资源Api';
COMMENT ON COLUMN "C_APPLICATIONS"."HOSTS" IS '主机';
COMMENT ON COLUMN "C_APPLICATIONS"."CREATED_TIME" IS '创建时间';
COMMENT ON COLUMN "C_APPLICATIONS"."MODIFIED_TIME" IS '修改时间';
COMMENT ON COLUMN "C_APPLICATIONS"."STATUS" IS '状态';
COMMENT ON COLUMN "C_APPLICATIONS"."SERVICE_MODE" IS '平台模式';
COMMENT ON COLUMN "C_APPLICATIONS"."UPDATED_BY_USER_NAME" IS '执行最后一次修改的用户名称';
COMMENT ON COLUMN "C_APPLICATIONS"."DEFAULT_INDEX_URL" IS '默认主页链接';


