CREATE TABLE C_RESOURCES
(
  ID number(15) not null primary key,
  APPLICATION_ID number(15) DEFAULT 0 NOT NULL,
  -- ui - UI组件
  -- /{page_name}/{element_name}
  --
  -- openApi - open api，对外开放的api，并非内部使用的api;
  --
  -- /api/v1/users
  -- 此时需要与dynamic properties配合，假如没有注册中心，直接指定某个property为ip:port;假如使用注册中心，直接指定某个property为service id
  --
  -- function - function opint,对应的是功能项，例如用户查询；
  -- 例如
  -- 一个具体的页面：
  -- /{page_name}
  --
  -- 某一个页面中的某个功能，例如用户组管理页面中的增加用户组的功能
  --
  -- /{page_name}/{function_name}
  PATH varchar(256) DEFAULT ' ' NOT NULL,
  ACTIONS varchar(256),
  NAME varchar(256) DEFAULT ' ' NOT NULL,
  REMARK varchar(256) DEFAULT '' NOT NULL,
  CREATED_TIME number(15) DEFAULT 0 NOT NULL,
  MODIFIED_TIME number(15) DEFAULT 0 NOT NULL,
  -- 资源类型例如，
  -- ui-UI组件，如button, input, textarea, table, drop down list等
  -- openApi-OpenApi, 如提供给其他应用调用的REST API。不是指应用内部的REST API
  -- function-功能项，如页面，菜单模块等
  TYPE varchar(50) DEFAULT ' ' NOT NULL,
  TENANT_ID number(15) DEFAULT 0 NOT NULL,
  VARCHAR_00 varchar(256),
  VARCHAR_01 varchar(256),
  VARCHAR_02 varchar(256),
  VARCHAR_03 varchar(256),
  VARCHAR_04 varchar(256),
  VARCHAR_05 varchar(256),
  VARCHAR_06 varchar(256),
  VARCHAR_07 varchar(256),
  VARCHAR_08 varchar(256),
  VARCHAR_09 varchar(256),
  VARCHAR_10 varchar(256),
  VARCHAR_11 varchar(256),
  VARCHAR_12 varchar(256),
  VARCHAR_13 varchar(256),
  VARCHAR_14 varchar(256),
  VARCHAR_15 varchar(256),
  VARCHAR_16 varchar(256),
  VARCHAR_17 varchar(256),
  VARCHAR_18 varchar(256),
  VARCHAR_19 varchar(256),
  INT_01 int,
  INT_02 int,
  INT_03 int,
  INT_04 int,
  INT_05 int,
  BOOLEAN_01 NUMBER(1),
  BOOLEAN_02 NUMBER(1),
  BOOLEAN_03 NUMBER(1),
  BOOLEAN_04 NUMBER(1),
  -- 更新的人
  UPDATED_BY_USER_NAME varchar(100) DEFAULT ' ' NOT NULL
) ;
COMMENT ON TABLE "C_RESOURCES" IS '资源表';
COMMENT ON COLUMN "C_RESOURCES"."ID" IS '表主键';
COMMENT ON COLUMN "C_RESOURCES"."APPLICATION_ID" IS '应用ID';
COMMENT ON COLUMN "C_RESOURCES"."PATH" IS '路径标识';
COMMENT ON COLUMN "C_RESOURCES"."ACTIONS" IS '行为';
COMMENT ON COLUMN "C_RESOURCES"."NAME" IS '资源名称';
COMMENT ON COLUMN "C_RESOURCES"."REMARK" IS '备注';
COMMENT ON COLUMN "C_RESOURCES"."CREATED_TIME" IS '创建时间';
COMMENT ON COLUMN "C_RESOURCES"."MODIFIED_TIME" IS '修改时间';
COMMENT ON COLUMN "C_RESOURCES"."TYPE" IS '资源类型配置代号';
COMMENT ON COLUMN "C_RESOURCES"."TENANT_ID" IS '租户ID';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_00" IS 'varchar字段00';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_01" IS 'varchar字段01';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_02" IS 'varchar字段02';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_03" IS 'varchar字段03';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_04" IS 'varchar字段04';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_05" IS 'varchar字段05';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_06" IS 'varchar字段06';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_07" IS 'varchar字段07';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_08" IS 'varchar字段08';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_09" IS 'varchar字段09';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_10" IS 'varchar字段10';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_11" IS 'varchar字段11';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_12" IS 'varchar字段12';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_13" IS 'varchar字段13';
COMMENT ON COLUMN "C_RESOURCES"."VARCHAR_14" IS 'varchar字段14';
