CREATE TABLE L_LOGS_D
(
  ID NUMBER(15) DEFAULT 0 NOT NULL primary key,
  CREATED_TIME NUMBER(15) DEFAULT 0 NOT NULL,
  MODIFIED_TIME NUMBER(15) DEFAULT 0 NOT NULL,
  USER_NAME VARCHAR(256) DEFAULT '' NOT NULL ,
  MESSAGE VARCHAR(256) DEFAULT '' NOT NULL ,
  TENANT_ID number(15),
  APPLICATION_ID number(15),
  IP VARCHAR(20),
  DAY_ID VARCHAR(30) DEFAULT to_char(current_timestamp,'yyyymmdd'),
  OPERATION VARCHAR(256)
);
COMMENT ON TABLE "L_LOGS_D" IS '日志表';
COMMENT ON COLUMN "L_LOGS_D"."ID" IS '表主键';
COMMENT ON COLUMN "L_LOGS_D"."CREATED_TIME" IS '创建时间';
COMMENT ON COLUMN "L_LOGS_D"."MODIFIED_TIME" IS '更新时间';
COMMENT ON COLUMN "L_LOGS_D"."USER_NAME" IS '用户名称';
COMMENT ON COLUMN "L_LOGS_D"."MESSAGE" IS '信息';
COMMENT ON COLUMN "L_LOGS_D"."TENANT_ID" IS '租户ID';
COMMENT ON COLUMN "L_LOGS_D"."APPLICATION_ID" IS '应用ID';
COMMENT ON COLUMN "L_LOGS_D"."IP" IS 'IP';
COMMENT ON COLUMN "L_LOGS_D"."DAY_ID" IS '操作日期';
COMMENT ON COLUMN "L_LOGS_D"."OPERATION" IS '操作';


CREATE TABLE C_SYSTEM_CONFIG
(
  ID NUMBER(15) NOT NULL primary key,
  PARAMETER varchar(256),
  VALUE varchar(256)
);
COMMENT ON TABLE "C_SYSTEM_CONFIG" IS '系统配置表';
COMMENT ON COLUMN "C_SYSTEM_CONFIG"."ID" IS '表主键';
COMMENT ON COLUMN "C_SYSTEM_CONFIG"."PARAMETER" IS '模式';
COMMENT ON COLUMN "C_SYSTEM_CONFIG"."VALUE" IS '值';

